import React from 'react';
import {Navbar,Nav,Container} from 'react-bootstrap';

const navbar = () => {
  return (
    <div className='bg-dark'>
      
      <Navbar bg='primary'>
        <Container>
        <li>
            Home
        </li>
        <li>
            ABOUT
        </li>
        <li>
            CONTACT
        </li>
        </Container>
       
      </Navbar>
    </div>
  )
}

export default navbar;
